import React from "react";

import "./Card.css";
import Cover from "../Pictures/HD.png";

function Card() {
  return (
    <>
      <div>
          <div className="multicolor-text">Hi!<br></br> I'm Khushboo. </div>
          <br></br>
          <p className="info">A front-end developer and general doodler with some mental issues.</p>
      </div>
      <div className="page">
        <div className="container">
          <img className="cover" src={Cover} alt="Cover_Picture" />
        </div>
      </div>
    </>
  );
}

export default Card;
